import React,{Component} from 'react';
import "semantic-ui-css/semantic.min.css";
import{
  Grid,
  Form,
  Button,
  Checkbox,
  Header
}from "semantic-ui-react";

class App extends Component {
  render(){
    return (
      <div>

        <Grid container columns={1}>
          <Grid.Column>
          </Grid.Column>
          <Grid.Column>
            <Form>
              <Header as="h3" color="teal">
                Member Login
              </Header>
            </Form>
          </Grid.Column>
          <Grid.Column>
          </Grid.Column>
        </Grid>

      </div>
    );
  }
}

export default App;
